import React, { useState } from 'react';
import './App.css';

const Monsters = () => {
  const pessoasLista = [
    {
      nome: 'Erison',
      idade: 22,
    },
    {
      nome: 'Karina',
      idade: 22,
    }
  ]
  const pessoa = pessoasLista.map(pessoa => <p>Eu sou o {pessoa.nome} e tenho {pessoa.idade} anos.</p>)
  return ( 
    <div>
      {pessoa}
    </div>
  );
}

export default ToDos;
